import City from './City.js'

const CityBlock = ({cities, onRefresh}) => {
  return(
      <>
        {cities.map((city) => (
          <City key={city.CityID} city={city} onRefresh={onRefresh}/ >
        ))}
      </>
  )
}

export default CityBlock
